public synchronized SchedulingRequest getRequest() {
  YarnProtos.RejectedSchedulingRequestProtoOrBuilder p =
      viaProto ? proto : builder;
  if (this.request != null) {
    return this.request;
  }
  if (!p.hasRequest()) {
    return null;
  }
  this.request = convertFromProtoFormat(p.getRequest());
  return this.request;
}
